import axios from "axios"

export default function getTimelineData(accessToken: string) {
    return axios.get("https://journey-timeline-backend.up.railway.app/timelinedata", {
        headers: {
            Authorization: `Bearer ${accessToken}`
        }
    })
        .then((res) => {
            return res.data;
        })

}
